import { useState } from 'react';
import InfiniteScroll from 'react-infinite-scroll-component';
import { Link } from 'react-router-dom';
import useVideoList from '../hooks/useVideoList';
import classes from './styles/Videos.module.css';
import Video from './Video';

export default function Videos() {
  const {loader, error, videos, hasMore} = useVideoList(0);
  const [page, setPage] = useState(1);

  return(
    <div className={classes.videos}>
      { videos.length > 0 && (
        <InfiniteScroll>
          {videos.map((video, index) => (
            <Link to="/quiz" key={video[index].youtubeID}>
              <Video title={video[index].title} id={video[index].youtubeID} noq={video[index].noq} />
            </Link>
          ))}
        </InfiniteScroll>
      )}
      {!loader && videos.length === 0 && (
        <div className=''>No data found !</div>
      )}
      {error && (
        <div className=''>There was an error !</div>
      )}
      {loader && (
        <div className=''>Loading...</div>
      )}
    </div>
  );
}
